import React from "react";

function HomeNavBar() {
  return (
    <ul>
      <li>NewFrame</li>
      <li>Home</li>
      <li>Pricing</li>
      <li>About Us</li>
      <li>Contact</li>
    </ul>
  );
}

export default HomeNavBar;
